import React from "react";
import './style.css';


function Sobre() {
    return(

        <section className="row">
             <div className="col-12 bg teste4">
            <h3>Na <span class="destaque">Viaje + </span>Vamos te ajudar a encontrar a melhor experiencia para seu momento sabativo!</h3>
            <h1 className="viajar">Entre em contato para saber mais!!<br /></h1>
            <br>
            </br>
            <h2 className="contato">Voce tambem pode enviar um e-mail para: viajemais@gmail.com</h2>
            </div>
        </section>
    )
}

export default Sobre;
